1Nnabiyaamu, an nín sá yii timbi ní Unimbɔti pɔ̃oǹ apoon gbantee, tí fámaan atuŋkpiti ŋin kɔkɔ bíiĺ tiwun nì kinaŋee, kí fàŋkì Unimbɔti kí nyāntí ti-pɔbiliŋ poon tikpiil kɔkɔ kí nīn bí circir. 2Ní dū ni-pɔbiliŋ kí tīīmaan-ti, di sá taa yīntiǹ ubɔ ni-kansikin, kaa bíil̀ ubɔ ni-kansikin, kaa jíń ni-kansikin ubɔ. 3Kaa sá m là kí wòoǹ-nee pu ní m lì míǹ, di sá m péēlī dooooyee yii ni kɔ́ ti-pɔbiliŋin tiŋan, báà dimaŋfalinaaan, ŋkúminaaan, ti dàá nīn gbíntì ki bí míǹ ní. 4M cáá dimákakpaandi ni-pu, n
