aa ŋá-ni ikpiti iba dee, an sá Unimbɔti di dī ni-nimbaaku pu ki gíiǹní-ni u-cee. 10Kun puee kunimbaau kun Unimbɔti kɔ̄ntí binibee cāabìń dibakpantil ní, ní unil ń ká difiil, ní kunimbaauee kaa ti páb̀-u. Ama kunimbaau kun kaa nyánní Unimbɔti ceeyee cāabìń ŋkúm ní. 11Ni ká Unimbɔti nín kɔ́ǹ-ni kunimbaau kuŋyee nín cáań-ni tiŋan tiŋyeeyaa! Ni kíǹ ki ŋúb́ Unimbɔti bɔti mmɔntiimin, ki kíǹ ki bíī gbàam̄ ni-bɔkpil pu. Tikpitil tin ŋée kaa mɔ́ɔkiǹ-ni, ni kíǹ ki fàŋkí Unimbɔti, ní an júkufí-ni ní ká-ti;

